import React from "react";
import CardItem from "./CardItem/CardItem";
import "./Cards.css";
const Cards = (props) => {
  return (
    <div className="cards">
      {props.items.map((item, i) => (
        <CardItem key={i} item={item} clicked={() => props.clicked(item.key)} />
      ))}
    </div>
  );
};

export default Cards;
